import React, { memo } from 'react'

const Home = () => {
  return (
    <div>
      <Title content='Blog Post App'/>
    </div>
  )
}

export default memo(Home)

const Title = ({content}) => {
    return (
        <h1 className='text-red-500'>Hello{content}</h1>
    )
}
